INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 27, "ヒヨリ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 100101, 8, "獣人族", "人助けが大好き！　前向き格闘娘", "東山奈央", 155, "人助け、応援", 16, "トゥインクルウィッシュ", "A", 44, 2);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 5, "ユイ", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 100201, 4, "ヒューマン", "戦闘のサポートが得意な、心優しい少女", "種田梨沙", 158, "料理、人間観察", 17, "トゥインクルウィッシュ", "O", 47, 2);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 12, "レイ", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 100301, 1, "魔族", "クールで何事にも真っ直ぐな剣士", "早見沙織", 163, "読書、乗馬、お茶", 18, "トゥインクルウィッシュ", "B", 46, 2);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 10, "ミソギ", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 100401, 8, "ヒューマン", "探検好きのイタズラっ子", "諸星すみれ", 128, "いたずら、探検", 9, "リトルリリカル", "O", 27, 5);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 25, "マツリ", "？？？", 100501, 11, "獣人族", "ヒーローに憧れる騎士見習いの少女", "下田麻美", 146, "ヒーローごっこ", 12, "王宮騎士団（NIGHTMARE）", "O", 40, 8);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 22, "アカリ", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 100601, 11, "魔族", "甘え上手なみんなの人気者", "浅倉杏美", 150, "サックス", 13, "悪魔偽王国軍（ディアボロス）", "O", 42, 7);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 23, "ミヤコ", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 100701, 1, "魔族", "プリン大好きゴースト娘", "雨宮天", 130, "プリンを食べること", 14, "悪魔偽王国軍（ディアボロス）", "B", 32, 7);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 10, "ユキ", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 100801, 10, "エルフ", "ボクは誰よりも美しい", "大空直美", 150, "鏡で自分を見ること", 14, "ヴァイスフリューゲル　ランドソル支部", "AB", 40, 15);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 5, "アンナ", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 100901, 7, "魔族", "前世を信じる中二病患者、「疾風の冥姫」", "髙野麻美", 159, "小説執筆", 17, "トワイライトキャラバン", "A", 45, 13);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 22, "マホ", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 101001, 9, "獣人族", "マホマホ王国のプリンセス", "内田真礼", 155, "空想、ぬいぐるみ集め", 16, "自警団（カォン）", "O", 42, 10);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 25, "リノ", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 101101, 8, "ヒューマン", "人懐っこくてマシンガントークな妹系少女", "阿澄佳奈", 156, "お裁縫", 15, "ラビリンス", "A", 44, 3);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 24, "ハツネ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 101201, 12, "エルフ", "みんなのために超能力を使う眠り姫", "大橋彩香", 156, "妹と遊ぶこと、二度寝、昼寝、早寝", 17, "フォレスティエ", "A", 46, 6);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 21, "ナナカ", "", 101301, 8, "魔族", "オタク全開な魔法少女", "佳村はるか", 166, "読書、魔法", 18, "トワイライトキャラバン", "O", 55, 13);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 3, "カスミ", "test", 101401, 11, "獣人族", "頭脳明晰な美少女名探偵", "水瀬いのり", 152, "読書、推理", 15, "自警団（カォン）", "AB", 41, 10);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 5, "ミサト", "test", 101501, 9, "エルフ", "母性溢れる優しいみんなの「ミサト先生」", "國府田マリ子", 165, "絵本作り", 21, "フォレスティエ", "O", 54, 6);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 10, "スズナ", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 101601, 4, "魔族", "天真爛漫で人気者のカリスマモデル", "上坂すみれ", 167, "ファッション", 18, "ルーセント学院", "O", 48, 14);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 7, "カオリ", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 101701, 7, "獣人族", "いつでも「なんくるないさ～」な天然娘", "高森奈津美", 158, "踊り、空手", 19, "自警団（カォン）", "A", 53, 10);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 14, "イオ", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 101801, 8, "魔族", "多くの男性を魅了する無垢な女教師", "伊藤静", 162, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 23, "ルーセント学院", "B", 52, 14);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 3, "ミミ", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 102001, 4, "獣人族", "お歌もにんじんも、ウサギさんも大好き♪", "日高里菜", 117, "かわいいもの集め", 10, "リトルリリカル", "O", 21, 5);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 9, "クルミ", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 102101, 6, "ヒューマン", "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", 150, "観劇、おままごと", 12, "サレンディア救護院", "B", 40, 9);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 22, "ヨリ", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 102201, 11, "魔族", "人見知りであまのじゃくな女の子", "原紗友里", 150, "ゲーム全般", 13, "悪魔偽王国軍（ディアボロス）", "O", 40, 7);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 10, "アヤネ", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 102301, 5, "ヒューマン", "ぷうきちといつも一緒！", "芹澤優", 148, "屋内でできる遊び", 14, "サレンディア救護院", "B", 38, 9);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 12, "スズメ", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 102501, 12, "ヒューマン", "お嬢さまのためにがんばるドジっ娘メイド", "悠木碧", 154, "ご奉仕", 15, "サレンディア救護院", "O", 43, 9);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 1, "リン", "test", 102601, 1, "獣人族", "遊びと睡眠が何より大事なぐうたら娘", "小岩井ことり", 144, "あんパン", 17, "牧場（エリザベスパーク）", "B", 42, 11);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 30, "エリコ", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 102701, 7, "魔族", "運命の相手に一途すぎる乙女", "橋本ちなみ", 154, "実験、裁縫、料理", 16, "トワイライトキャラバン", "B", 43, 13);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 4, "サレン", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 102801, 10, "エルフ", "救護院を経営する優しい庶民派お嬢様", "堀江由衣", 156, "経営、お茶会", 17, "サレンディア救護院", "A", 43, 9);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 24, "ノゾミ", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 102901, 1, "ヒューマン", "歌って踊れる大人気アイドル", "日笠陽子", 157, "舞台鑑賞、ダンス", 17, "カルミナ", "B", 40, 4);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 31, "ニノン", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 103001, 8, "ヒューマン", "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", 163, "忍法開発", 16, "ヴァイスフリューゲル　ランドソル支部", "O", 51, 15);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 22, "シノブ", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 103101, 12, "魔族", "占いが得意な霊能少女", "大坪由佳", 157, "占い", 18, "悪魔偽王国軍（ディアボロス）", "AB", 42, 7);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 12, "アキノ", "この私とともにいる限り、\nお金に不自由はさせませんわ！", 103201, 3, "ヒューマン", "一人前の商人を目指すパワフルお嬢様", "松嵜麗", 157, "慈善事業", 18, "メルクリウス財団", "AB", 45, 12);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 3, "マヒル", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 103301, 3, "ヒューマン", "みんなを笑顔にするお笑い牧場主", "新田恵海", 142, "漫才", 20, "牧場（エリザベスパーク）", "B", 35, 11);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 16, "ユカリ", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 103401, 3, "エルフ", "純情でほっとけない大人の女性", "今井麻美", 164, "ウインドーショッピング", 22, "メルクリウス財団", "A", 55, 12);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 2, "キョウカ", "test", 103601, 2, "エルフ", "礼儀正しくしっかり者のちびっ子優等生", "小倉唯", 118, "お勉強", 8, "リトルリリカル", "A", 21, 5);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 11, "トモ", "test", 103701, 8, "ヒューマン", "義理堅くてからかい好きな剣術少女", "茅原実里", 149, "剣術、年長者をからかう", 13, "王宮騎士団（NIGHTMARE）", "A", 43, 8);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 3, "シオリ", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 103801, 11, "獣人族", "読書が趣味の病弱少女", "小清水亜美", 153, "読書、お散歩", 14, "牧場（エリザベスパーク）", "A", 40, 11);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 6, "アオイ", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 104001, 6, "エルフ", "「友達」に憧れる、エルフの森の女の子", "花澤香菜", 158, "友達作りのイメトレ", 13, "フォレスティエ", "AB", 44, 6);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 3, "チカ", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 104201, 6, "ヒューマン", "人々を守るために歌う、唱喚士の少女", "福原綾香", 163, "各種楽器", 17, "カルミナ", "O", 46, 4);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 9, "マコト", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 104301, 8, "獣人族", "男勝りで情に厚いワイルド娘", "小松未可子", 168, "お菓子作り", 17, "自警団（カォン）", "O", 54, 10);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 5, "イリヤ", "test", 104401, 5, "魔族", "かつては夜を支配した最強の吸血鬼", "丹下桜", 172, "世界征服", "??", "悪魔偽王国軍（ディアボロス）", "A", 50, 7);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 19, "クウカ", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 104501, 11, "ヒューマン", "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", 157, "小説を読むこと", 18, "ヴァイスフリューゲル　ランドソル支部", "AB", 49, 15);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 1, "タマキ", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 104601, 3, "獣人族", "弱きを助け強きをくじく猫娘", "沼倉愛美", 158, "猫とたわむれること", 18, "メルクリウス財団", "AB", 48, 12);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 25, "ジュン", "？？？", 104701, 10, "ヒューマン", "素顔を見せない冷静沈着な女性騎士", "川澄綾子", 171, "格闘技、湯浴み", 25, "王宮騎士団（NIGHTMARE）", "A", 50, 8);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 11, "ミフユ", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 104801, 11, "ヒューマン", "仕事も私事も効率優先な傭兵少女", "田所あずさ", 163, "傭兵などのアルバイト", 20, "メルクリウス財団", "O", 49, 12);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 24, "シズル", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 104901, 10, "ヒューマン", "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", 168, "家事全般", 18, "ラビリンス", "O", 54, 3);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 3, "ミサキ", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 105001, 1, "魔族", "ちょっとおませな恋に恋する女の子", "久野美咲", 120, "ファッション誌鑑賞、コスメ集め", 11, "ルーセント学院", "A", 22, 14);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 7, "ミツキ", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 105101, 3, "ヒューマン", "実験が趣味の危険な科学者", "三石琴乃", 166, "研究、実験", 27, "トワイライトキャラバン", "A", 53, 13);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 14, "リマ", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 105201, 3, "獣人族", "乙女チックなもふもふアニマル", "徳井青空", 150, "毛繕い、お喋り", 18, "牧場（エリザベスパーク）", "A", 100, 11);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 28, "モニカ", "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 105301, 7, "ヒューマン", "見た目も中身もお子ちゃまな異国の軍人", "辻あゆみ", 140, "お菓子屋通い", 18, "ヴァイスフリューゲル　ランドソル支部", "A", 33, 15);
