INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 11, "ルカ", "test", 105601, 7, "ヒューマン", "人情味溢れる粋でいなせな「姉御」", "佐藤利奈", 167, "釣り", 25, "トワイライトキャラバン", "B", 54, 13);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 10, "ジータ", "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 105701, 3, "ヒューマン", "空への冒険を夢見る騎空士の少女", "金元寿子", 156, "冒険、おしゃべり", 17, "？？？", "O", 45, "");
