INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 2, "キャル", "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 106001, 9, "獣人族", "行き倒れの謎のネコミミ魔法使い", "立花理香", 152, "猫と遊ぶ", 14, "美食殿", "A", 39, 1);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 11, "ムイミ", "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 106101, 8, "ヒューマン", "さまよえる謎の少女", "潘めぐみ", 148, "冒険、思い出話", 16, "？？？", "O", 40, "");
