INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 11, "コッコロ（サマー）", "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 107601, 5, "エルフ", "主を慕う、小さなガイド役", "伊藤美来", 140, "瞑想、動植物の飼育", 11, "美食殿", "B", 35, 1);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 12, "スズメ（サマー）", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 107701, 12, "ヒューマン", "お嬢さまのためにがんばるドジっ娘メイド", "悠木碧", 154, "ご奉仕", 15, "サレンディア救護院", "O", 43, 9);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 2, "キャル（サマー）", "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 107801, 9, "獣人族", "行き倒れの謎のネコミミ魔法使い", "立花理香", 152, "猫と遊ぶ", 14, "美食殿", "A", 39, 1);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 1, "タマキ（サマー）", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 107901, 3, "獣人族", "弱きを助け強きをくじく猫娘", "沼倉愛美", 158, "猫とたわむれること", 18, "メルクリウス財団", "AB", 48, 12);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 11, "ミフユ（サマー）", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 108001, 11, "ヒューマン", "仕事も私事も効率優先な傭兵少女", "田所あずさ", 163, "傭兵などのアルバイト", 20, "メルクリウス財団", "O", 49, 12);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 22, "シノブ（ハロウィン）", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 108101, 12, "魔族", "占いが得意な霊能少女", "大坪由佳", 157, "占い", 18, "悪魔偽王国軍（ディアボロス）", "AB", 42, 7);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 23, "ミヤコ（ハロウィン）", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 108201, 1, "魔族", "プリン大好きゴースト娘", "雨宮天", 130, "プリンを食べること", 14, "悪魔偽王国軍（ディアボロス）", "B", 32, 7);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 3, "ミサキ（ハロウィン）", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 108301, 1, "魔族", "ちょっとおませな恋に恋する女の子", "久野美咲", 120, "ファッション誌鑑賞、コスメ集め", 11, "ルーセント学院", "A", 22, 14);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 3, "チカ（クリスマス）", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 108401, 6, "ヒューマン", "人々を守るために歌う、唱喚士の少女", "福原綾香", 163, "各種楽器", 17, "カルミナ", "O", 46, 4);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 9, "クルミ（クリスマス）", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 108501, 6, "ヒューマン", "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", 150, "観劇、おままごと", 12, "サレンディア救護院", "B", 40, 9);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 10, "アヤネ（クリスマス）", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 108601, 5, "ヒューマン", "ぷうきちといつも一緒！", "芹澤優", 148, "屋内でできる遊び", 14, "サレンディア救護院", "B", 38, 9);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 27, "ヒヨリ（ニューイヤー）", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 108701, 8, "獣人族", "人助けが大好き！　前向き格闘娘", "東山奈央", 155, "人助け、応援", 16, "トゥインクルウィッシュ", "A", 44, 2);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 5, "ユイ（ニューイヤー）", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 108801, 4, "ヒューマン", "戦闘のサポートが得意な、心優しい少女", "種田梨沙", 158, "料理、人間観察", 17, "トゥインクルウィッシュ", "O", 47, 2);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 12, "レイ（ニューイヤー）", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 108901, 1, "魔族", "クールで何事にも真っ直ぐな剣士", "早見沙織", 163, "読書、乗馬、お茶", 18, "トゥインクルウィッシュ", "B", 46, 2);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 30, "エリコ（バレンタイン）", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 109001, 7, "魔族", "運命の相手に一途すぎる乙女", "橋本ちなみ", 154, "実験、裁縫、料理", 16, "トワイライトキャラバン", "B", 43, 13);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 24, "シズル（バレンタイン）", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 109101, 10, "ヒューマン", "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", 168, "家事全般", 18, "ラビリンス", "O", 54, 3);
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 1, "アン", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 109201, 12, "ヒューマン", "英霊と契約を結んだマナリアの天才王女", "日笠陽子", 156, "読書", 17, "？？？", "AB", 55, "");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 4, "ルゥ", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 109301, 2, "ヒューマン", "マナリア魔法学院の新入生", "こやまきみこ", 144, "食べること、眠ること", 15, "？？？", "O", 45, "");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (0, 3, "グレア", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 109401, 11, "半人半竜", "人を超越した力を有す心優しい竜姫", "福原綾香", 167, "ピアノ", 17, "？？？", "B", 67, "");
